// src/components/ProfileMenu.js
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './ProfileMenu.css';


function ProfileMenu() {
  const [open, setOpen] = useState(false);
  const navigate = useNavigate();

  const handleLogout = () => {
    // Aquí puedes limpiar cualquier dato de sesión
    navigate('/');
  };

  return (
    <div className="profile-menu">
      <button onClick={() => setOpen(!open)} className="profile-button">
        Perfil
      </button>
      {open && (
        <div className="dropdown-menu">
          <button onClick={() => navigate('/settings')}>Modificar Cuenta</button>
          <button onClick={handleLogout}>Cerrar Sesión</button>
        </div>
      )}
    </div>
  );
}

function Dashboard() {
    return (
        <div>
            <h1>Bienvenido al Panel Principal</h1>
            {/* Aquí puedes posicionar el ProfileMenu en la esquina */}
            <ProfileMenu />
            {/* Resto del código */}
        </div>
    );
}


export default ProfileMenu;
